INSERT INTO `ps_category_lang` (`id_category`, `id_shop`, `id_lang`, `name`, `description`, `link_rewrite`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
	(1, 1, 2, 'Accueil', NULL, 'home', NULL, NULL, NULL),
	(39, 1, 2, 'Riello iPlug', 'La série iPLUG est la solution adéquate vouée à la protection des services domestiques et de bureau. Sa forme compacte et la polyvalence d’utilisation (un bouton avec synoptique à led et batteries interchangeables directement par l’utilisateur) font de iPLUG un dispositif à la portée de tous les usagers, aussi pratique et facile qu’un appareil ménager, pour la protection contre les surtensions et coupures de courant.\r\nEn l’absence de réseau, la charge sera alimentée par un inverseur avec onde pseudo sinusoïdale pendant le temps nécessaire à la fermeture des systèmes informatiques au moyen du logiciel PowerShield', 'gamme-riello-iplug', 'Onduleurs Off-line Riello iPlug', 'onduleurs,onduleur,riello,iPlug, offline', NULL),
	(40, 1, 2, 'Riello Vision', 'La série VISION est disponible selon les versions Tower (VST), dans les modèles de 800 VA à 2000 VA avec technologie sinusoïdale numérique. \r\n\r\nLa série VISION, pour la connectivité et la communication évoluée, est la solution idéale pour les utilisateurs les plus exigeants, qui demandent une protection élevée et une grande polyvalence du système d’alimentation. \r\n\r\nVISION est la meilleure protection pour les périphériques de réseau, les serveurs conventionnels et les systèmes backup de réseau.', 'gamme-riello-vision', 'Onduleurs Line-interactive Riello Vision', NULL, NULL),
	(5, 1, 2, ' Onduleurs OFF-Line', 'Cette technologie est la plus fréquemment utilisé pour la protection des PC en environnement peu perturbé. En mode normal, l\'onduleur alimente l\'application avec le secteur, simplement filtré mais sans aucune conversion d\'énergie. Son principe de fonctionnement est séquentiel (sur secteur / sur batterie). En cas de coupure, de baisse ou hausse de tension, l\'onduleur puise son énergie dans sa batterie pour fournir une énergie stabilisée. Son utilisation est inadaptée en cas de perturbations fréquentes.', 'onduleurs-off-line', 'Onduleurs Off-line', 'onduleur offline, onduleur off line, protection pc', 'La technologie Off-line est la plus fréquemment utilisé pour la protection des PC en environnement peu perturbé.'),
	(38, 1, 2, 'Riello iDialog', 'La gamme iDialog est la solution idéale pour la protection des PC et des périphériques en milieu domestique et professionnel.\r\niDiaolg est une solution facile à installer et avantageuse pour protéger :\r\n\r\nappareils informatiques tels que PC, Media Centers et périphériques\r\nTV, Home Cinéma, récepteurs satellites numériques terrestres, lecteurs et graveurs DVD.\r\nModems et routeurs xDSL\r\nPetits électroménagers.', 'gamme-riello-idialog', 'Onduleurs Off-line Riello iDialog', 'onduleurs,onduleur,riello,idialog, offline', NULL),
	(36, 1, 2, 'Eaton 9135', 'L’onduleur Eaton 9135, combiné rack/tour, offre une protection électrique totale aux équipements sensibles tels que serveurs, équipements réseaux et VoIP. Utilisé en onduleur rackable, il n’occupe qu’une hauteur de 6U dans la baie. Des modules d’extension batterie externe de 3U permettent de prolonger son autonomie.', 'gamme-eaton-9135', NULL, NULL, NULL),
	(6, 1, 2, 'Onduleurs ON-Line (double-conversion)', 'Cette technologie est adaptée à la protection centralisée de serveurs garantissant une qualité constante quelles que soient  les perturbations du secteur. Dans l\'onduleur On-Line, la double conversion permanente élimine les perturbations électriques qui peuvent endommager un ordinateur: le courant est entièrement régénéré par transformation d\'alternatif en continu, puis à nouveau de continu en alternatif. Il est indispensable pour la protection permanente. L\'onduleur On-Line est compatible avec tout type de charge car il ne génère pas de micro-coupure lors du passage sur batterie.\r\nCette technologie plus performantes garantie une protection constante contre tout type de perturbation et une régulation permanente de la tension de sortie.', 'onduleur-double-conversion-on-line', NULL, NULL, NULL),
	(7, 1, 2, 'Onduleurs Line-Interactive', 'Cette technologie est utilisée pour protéger les réseaux et les applications informatiques des entreprises. En mode normal, l\'appareil est géré par un microprocesseur qui surveille la qualité du réseau électrique et réagit aux variations. Un booster et un fader, circuits de compensation de tension, sont activés en cas de variation de l\'amplitude de la tension. Cette technologie pallie aux baisses et hausses de tension prolongées sans sollicitation des batteries.', 'onduleurs-line-interactive', NULL, NULL, NULL),
	(10, 1, 2, 'Eaton 5110', 'La gamme EATON 5110 pour les PCs et stations de travail. Il peut protéger des coupures secteur, des creux de tension, des surtensions, des baisse et hausse de tension. Son régulateur automatique de tension permet de ne pas épuiser la batterie inutilement. Cet onduleur protège l\'équipement des surtensions venant du réseau informatique ou des lignes téléphoniques.\r\nCette gamme très compacte et silencieuse est équipée d\'un port de communication USB.\r\n\r\nDe plus cet onduleur est totalement silencieux car FANLESS (sans ventilateur)', 'gamme-eaton-5110', 'Onduleurs Line-interactive Eaton 5110', NULL, NULL),
	(9, 1, 2, 'Gamme Eaton 3105', 'L’Eaton 3105 est un onduleur économique idéal pour protéger les PCs, terminaux points de vente et applications Home Cinéma.\r\n \r\nÉquipé de prise de sortie secourues, il garde les équipements essentiels en fonctionnement pendant les coupures de courant, les autres étant connectés aux prises protégées contre les surtensions seulement. Le 3105 s’installe sous un bureau ou au mur. \r\n\r\n- prises secourues et protégées des surtensions + prises protégées des surtensions seulement\r\n- Batteries remplaçables par l’utilisateur\r\n- Châssis compact à placer sous un bureau ou à fixer au mur\r\n- Protège l’équipement des surtensions venant de la ligne réseau ou des lignes téléphoniques\r\n- Vous informe des problèmes d’alimentation et d’un niveau de batterie faible par alarme sonore et envoi de message\r\n- Logiciel de communication par port USB fourni.\r\n', 'gamme-eaton-3105', 'Onduleurs Eaton 3105', 'onduleur,onduleurs,powerware,eaton,3105,offline,off-line,passive stand-by', NULL),
	(35, 1, 2, 'Multiprises pour onduleurs', 'Des multiprises pour bancher sur vos onduleurs!', 'multiprises-pour-onduleurs', 'multiprises, onduleurs, IEC', 'multiprises, onduleurs, IEC', 'multiprises, onduleurs, IEC'),
	(11, 1, 2, 'Eaton 5115', 'Cet onduleur garantit une sortie sinusoïdale pure en mode batterie qui lui permet d\'assurer la protection des serveurs.', 'gamme-eaton-5115', 'Onduleurs Line-interactive Eaton 5115', NULL, NULL),
	(12, 1, 2, 'Eaton 5115 RM', 'Cette gamme RM (rackmount) allie à la fois performance, fiablité et Souplesse d\'utilisation. Elle garantie une sortie sinusoïdale pure en mode batterie qui lui permet d\'assurer la protection des serveurs.', 'gamme-eaton-5115-rm', 'Onduleurs Line-interactive Eaton 5115 RM', NULL, NULL),
	(13, 1, 2, 'Eaton 9130', 'L\'’onduleur Eaton 9130 assure la protection totale de tout équipement sensible qui exige une alimentation très fiable (serveurs, VOIP, équipements IT et réseaux). Il est très économe en énergie grâce à des performances de premier ordre (rendement de 95% en mode online et de 98% en mode optimisé) et/ou nécessitant un signal électrique parfait (moteur, automate...) . Il bénéficie de la technologie ABM de gestion intelligente des batteries qui accroît considérablement leur durée de service.', 'gamme-eaton-9130', NULL, NULL, NULL),
	(31, 1, 2, 'Eaton 3S', 'L’Eaton 3S UPS protège les équipements informatiques des perturbations électriques les plus répandues telles que coupures de courant, creux et surtensions. Il prend aussi en compte les périphériques, imprimantes par exemple, utilisant un transformateur. Ce nouvel onduleur offline est disponible en modèles 6 prises françaises ou DIN, ou 8 prises IEC.\r\n\r\nLa mise en œuvre du 3S est très facile. Il s’intègre automatiquement avec Windows, Mac et Linux, sans qu’il soit nécessaire d’installer de pilotes. Il peut alors fonctionner en toute transparence avec les logiciels de gestion de l’énergie supportés par ces systèmes d’exploitation, de même qu’avec celui fourni par Eaton. Enfin, sa batterie remplaçable permet de prolonger sa durée de vie.', 'gamme-eaton-3s', 'Onduleurs Off-line Eaton 3S - Protection informatique', 'eaton 3s, onduleurs pc,onduleur informatique', 'Les onduleurs Eaton 3S protègent les équipements informatiques des perturbations électriques les plus répandues.'),
	(14, 1, 2, 'Gamme Eaton 5125', '- Augmentation de l’autonomie par modules batteries externes (EBMs)\r\n- Durée de vie batterie prolongée de 50% grâce à ABM\r\n- Filtrage de réseau informatique (prises RJ-45)\r\n- Livré en standard avec câble et logiciel d\'Arrêt et de Supervision\r\n- Régule les fluctuations de la tension d’entrée grâce à une technique élévateur/abaisseur (Buck & Boost)\r\n- Segments de charge l\'autonomie batterie est prioritairement dédiée aux équipements les plus sensibles ', 'gamme-eaton-5125', NULL, NULL, NULL),
	(34, 1, 2, 'Gamme POWERWARE', 'Kits de batteries gamme powerware', 'gamme-powerware', NULL, 'batteries, kits batteries, powerware, EATON', 'batteries, kits batteries, powerware, EATON'),
	(15, 1, 2, 'Eaton 5130', '    * Fourni en standard avec logiciel d’arrêt/supervision\r\n    * Grâce à son facteur de puissance 0,9 en sortie, il fournit plus de puissance active dans un espace moindre pour connecter davantage d’équipements client\r\n    * Modules batteries externes (EBM) optionnelles pour prolonger l’autonomie jusqu’à 4 heures\r\n    * Offre le choix de l’installation tour ou rack (tous accessoires fournis en standard)\r\n    * Se présente sous forme d’un ensemble compact de 2U ou 3U, batteries internes comprises, et offre le choix entre installation en baie ou de type tour\r\n    * Un maximum de disponibilité grâce à des cabinets batteries externes, des batteries remplaçables à chaud et un bypass manuel de maintenance optionnel', 'gamme-eaton-5130', 'Onduleurs Line-interactive Eaton 5130', NULL, NULL),
	(16, 1, 2, '350 - 1000 VA', 'Retrouvez ici tous les gammes d\'onduleurs dont la puissance est inferieur a 1000 VA', '350-1000-va', 'Onduleurs inferieur a 1000VA', NULL, 'Retrouvez ici tous les gammes d\'onduleurs dont la puissance est inferieur a 1000 VA'),
	(17, 1, 2, '1000 - 1500 VA', 'Retrouvez ici tous les gammes d\'onduleurs dont la puissance est située entre 1000 et 1500 VA.', '1000-1500-va', 'Onduleurs entre 1000 et 1500 VA', NULL, 'Retrouvez ici tous les gammes d\'onduleurs dont la puissance est située entre 1000 et 1500 VA.'),
	(18, 1, 2, 'Puissance', NULL, 'chercher-onduleur-par-puissance', 'Onduleur par puissance', 'eaton,powerware,asi powerware, puissance', 'Gammes d\'onduleurs classés par puissance. Retrouvez tous nos onduleurs plus facilement grâce à un trie par puissance.'),
	(33, 1, 2, 'Kits de batteries', 'Kits de batteries pour onduleurs Powerware', 'kits-de-batteries', NULL, 'batteries, kits batteries, powerware', NULL),
	(19, 1, 2, 'Topologie', NULL, 'chercher-onduleur-par-type', 'Onduleur Eaton par topologie', 'eaton,powerware,asi powerware, topologie, offline,online,line-interactive', 'Gammes d\'onduleurs Eaton classées par topologie.  Retrouvez tous nos onduleurs plus facilement grâce à un trie par type ou topologie. 3 types : offline, line-interactive et online.'),
	(20, 1, 2, '1500 - 3000 VA', 'Retrouvez ici tous les gammes d\'onduleurs dont la puissance est située entre 1500 et 3000 VA.', '1500-3000-va', 'Onduleurs entre 1500 et 3000 VA', NULL, 'Retrouvez ici tous les gammes d\'onduleurs dont la puissance est située entre 1500 et 3000 VA.'),
	(21, 1, 2, 'Eaton 9130 RM', 'L\'’onduleur Eaton 9130 assure la protection totale de tout équipement sensible qui exige une alimentation très fiable (serveurs, VOIP, équipements IT et réseaux). Il est très économe en énergie grâce à des performances de premier ordre (rendement de 95% en mode online et de 98% en mode optimisé) et/ou nécessitant un signal électrique parfait (moteur, automate...) . Il bénéficie de la technologie ABM de gestion intelligente des batteries qui accroît considérablement leur durée de service.', 'gamme-eaton-9130-rm', NULL, NULL, NULL),
	(37, 1, 2, 'Eaton 9140', 'L’onduleur Eaton 9140 est un onduleur on line double conversion rackable qui offre une protection fiable et efficace des systèmes en racks moyenne et haute densité. Il répond aux problèmes de densité de puissance et d’espace posés par les centres de données actuels. C’est le premier onduleur de hauteur 6U, batteries internes comprises, capable de fournir de 7,5 kVA à 10kVA. ', 'gamme-eaton-9140', NULL, NULL, NULL),
	(22, 1, 2, '3000 VA - 10KVA', 'Retrouvez ici tous les gammes d\'onduleurs dont la puissance est située entre 3000 et 10K VA.', '3000-10k-va', 'Onduleurs entre 3000 et 10K VA', NULL, 'Retrouvez ici tous les gammes d\'onduleurs dont la puissance est située entre 3000 et 10K VA.'),
	(23, 1, 2, ' Autres modèles', NULL, 'autre-modeles', NULL, NULL, NULL),
	(26, 1, 2, 'Packs Garanties', 'Extensions de garanties', 'garanties', 'Extensions de garanties', NULL, NULL),
	(27, 1, 2, 'Accessoires', 'Vous trouverez dans cette catégorie des accessoires pour votre onduleur. Des cartes de communication permettant de connecter l\'onduleur à votre réseau Ethernet mais aussi des flexPDU, ...', 'accessoires', 'Accessoires pour onduleurs Eaton', 'cartes snmp, carte de communication, flex pdu, accessoires onduleurs, accessoire onduleur', 'Toute une gamme d\'accessoires est disponible pour les onduleurs. '),
	(28, 1, 2, 'Cartes de communication', 'Les cartes ConnectUPS Web/SNMP connectent votre onduleur Eaton au réseau Ethernet et à l’Internet. Vous pouvez gérer votre onduleur avec votre navigateur Web standard et arrêter, à distance, les équipements informatiques qu’il protége.', 'cartes-de-communication', 'Cartes de communication pour onduleur', NULL, NULL),
	(32, 1, 2, 'Eaton Flex PDU', 'Les FlexPDU (Power Distribution Unit) sont une gamme de barrettes multiprises multipositions conçues pour raccorder facilement de nombreux équipements à un onduleur.', 'eaton-flex-pdu', NULL, NULL, NULL),
	(41, 1, 2, 'Riello Sentinel Dual (Low Power)', 'SENTINEL DUAL est la nouvelle gamme d’UPS online double conversion à très haute densité, adapté pour alimenter un vaste choix de dispositifs comme des serveurs, des systèmes de stockage, des appareils de téléphonie - VoIP, des systèmes de réseau et médicaux tout comme dans les environnements industriels. ', 'gamme-riello-sentinel-dual', NULL, 'Riello Gamme Riello Sentinel Dual (Low Power)', 'Gamme Riello Sentinel Dual (Low Power) RIELLO'),
	(42, 1, 2, 'Riello Sentinel Dual High Power', 'La série SENTINEL DUAL (High Power) est disponible dans les modèles 3,3-4-5-6-8-10kVA monophasé et 6,5-8-10kVA triphasé/monophasé à technologie on-line à double conversion (VFI): la charge est toujours alimentée par l’onduleur qui fournit une tension sinusoïdale, filtrée et stabilisée du point de vue de la tension, de la forme et de la fréquence. En outre, les filtres d’entrée et de sortie augmentent considérablement l’immunité de la charge contre les perturbations de réseau et la foudre', 'gamme-riello-sentinel-dual-high-power', NULL, 'Riello UPS onduleur ASI  Sentinel Dual High Power', 'Riello UPS onduleur ASI  Sentinel Dual High Power'),
	(50, 1, 2, 'Parasurtenseurs / Parafoudre', 'Protection surtensions & parafoudre', 'protection-surtensions-parafoudre', NULL, NULL, NULL),
	(46, 1, 2, 'Occasions', 'Matériel d\'occasion et autres', 'occasions', NULL, 'occasions', 'occasions'),
	(47, 1, 2, 'Pack & Promos', 'Promotions et Packs', 'pack-et-promos', NULL, NULL, NULL),
	(48, 1, 2, 'Promos en cours', NULL, 'promos-en-cours', NULL, NULL, NULL),
	(49, 1, 2, 'Eaton EX', 'Onduleur double conversion (on-line) à facteur de puissance 0.9', 'gamme-eaton-ex', NULL, NULL, NULL),
	(51, 1, 2, 'Gamme Eaton Protection Box', 'Une solution simple et économique pour protéger les équipements sensibles\r\n\r\nProtection idéale pour :\r\n\r\n    Informatique et périphériques associés, media center\r\n    Équipements TV/Video/Hi-Fi : TV, ensemble Home cinéma, graveurs DVD, décodeurs numériques...\r\n    Modem Internet xDSL/TV xDSL\r\n    Téléphonie\r\n    Électroménager...\r\n', 'protection-box', NULL, NULL, NULL),
	(53, 1, 2, 'Eaton Protection Station', 'L’Eaton Protection Station est un combiné onduleur + parafoudre + multiprise avec fonction économie d’énergie', 'gamme-eaton-protection-station', 'Onduleurs Off-line Eaton Protection Station', 'onduleur,onduleurs,eaton,protection station,offline', NULL),
	(54, 1, 2, 'Eaton Ellipse ECO', 'L’Eaton Ellipse ECO est un onduleur extra plat avec parafoudre intégré, conforme IEC 61643-1. Grâce à sa fonction EcoControl, disponible sur les modèles USB, l’Eaton Ellipse ECO vous assure jusqu’à 25% d’économie d’énergie par rapport aux onduleurs de génération précédente.', 'gamme-eaton-ellipse-eco', 'Onduleurs Off-line Eaton Ellipse ECO', 'Onduleur Ellipse Eco, ASI pulsar', NULL),
	(55, 1, 2, 'Eaton Ellipse MAX', 'Une protection efficace des stations de travail et des serveurs. Technologie Line Interactive. L\' Ellipse MAX garantit une protection efficace et ce même dans des environnements électriques perturbés. Les variations de tension sont automatiquement corrigées par un dispositif de type AVR .', 'gamme-eaton-ellipse-max', 'Onduleurs Line-interactive Eaton Ellipse MAX', NULL, NULL),
	(56, 1, 2, 'Racks & Kits onduleur', 'Pour l\'intégration de vos onduleur dans vos baies', 'racks-kits-onduleur', 'intégration, onduleur, baies', 'intégration, onduleur, baies', 'intégration, onduleur, baies'),
	(57, 1, 2, 'Eaton Evolution', 'L’Eaton Evolution est doté de la technologie Line-Interactive. Haute densité, il optimise la place disponible (jusqu’à 1550VA sur 1U) dans les environnements informatiques ou télécoms. Il offre aussi de nombreuses possibilités de communication et de supervision Réseau.', 'gamme-eaton-evolution', 'Onduleurs Line-interactive Eaton Evolution', NULL, NULL),
	(58, 1, 2, 'Eaton 5PX', 'L’Eaton 5PX Rack/Tour est un onduleur line-interactive qui assure la protection efficace des serveurs, des systèmes de stockage et des équipements réseaux. C’est un onduleur très moderne pour la protection des d’équipements d’aujourd’hui : un écran LCD de nouvelle génération, jusqu’à 99% de rendement, la possibilité de mesurer la consommation électrique au niveau d’un groupe de prises, une extension de son autonomie grâce à des packs batteries externes.', 'gamme-eaton-5px', 'Onduleurs Line-interactive Eaton 5130', NULL, NULL),
	(59, 1, 2, 'By Pass 0-3 Kva / Hotswap', 'Grâce au HotSwap MBP (Maintenance By-Pass), tout onduleur de moins de 3 kVA peut bénéficier de la fonction "échange à chaud" : le remplacement ou l\'upgrade d\'un onduleur se passe sans aucune interruption pour l\'application protégée.', 'by-pass-0-3-kva', 'hotswap by-pass', 'hotswap by-pass', 'hotswap by-pass'),
	(60, 1, 2, 'Transfert de Source STS', 'EATON Système de Transfert de Source STS', 'transfert-de-source-sts', NULL, NULL, NULL),
	(61, 1, 2, 'EATON MX / EATON MX Frame', 'L’onduleur Eaton MX/ MX Frame, de la famille Pulsar, est une solution modulaire de 4 à 20kVA, pour « cœurs de Réseaux » et salles serveurs. Un onduleur on-line double conversion unique, convertible au format Tour et Rack, et évolutif sans surcoût à l’achat.', 'gamme-eaton-mx-eaton-mx-frame', NULL, NULL, NULL),
	(62, 1, 2, 'Eaton EX RT 3:1', 'L’onduleur Eaton EX RT, de la famille Pulsar, est un onduleur on-line monophasé en sortie, et disponible en  triphasé en entrée.', 'gamme-eaton-ex-rt-1-1-3-1', 'Gamme Eaton EX RT 3:1', 'Gamme Eaton EX RT 3:1', 'Gamme Eaton EX RT 3:1'),
	(64, 1, 2, 'APC Smart UPS SC', 'APC Smart-UPS SC est la protection parfaite pour les ressources informatiques de plus en plus nombreuses de votre entreprise. Facile à gérer, l\' APC Smart-UPS SC est conçue pour les PME qui cherchent à protéger l\'alimentation et les données des serveurs et équipements réseau. Le logiciel de gestion inclus vous permet de configurer la fermeture de vos systèmes en toute sécurité et de profiter de fonctions de gestion d\'onduleur avancées, telles que les évaluations automatisées des risques et les calculs de capacité de fonctionnement. La connectivité s\'effectue via le port série. Lorsque vous êtes prêt à à passer à un niveau supérieur, vous pouvez utiliser le même environnement logiciel que celui de Smart-UPS SC pour gérer de manière transparente d\'autres modèles Smart-UPS, ce qui vous permet d\'étendre votre infrastructure informatique sans avoir à remplacer ou à former à nouveau vos ressources de gestion. Bâti sur les mêmes standards que l\'onduleur primé Smart-UPS, Smart-UPS SC est l\'onduleur idéal pour démarrer votre entreprise.', 'gamme-apc-smart-ups', 'Onduleurs Line-interactive APC Smart UPS SC', 'APC Smart UPS SC, apc, smart ups, ups', 'La gamme d\'onduleurs APC Smart UPS SC fait partie des gammes d\'onduleurs de type line-interactive'),
	(65, 1, 2, 'APC Back-UPS ES', 'La gamme APC Back-UPS offre une protection de l\'alimentation garantie pour les réseaux sans fil, les ordinateurs, les consoles de jeux, ainsi que d\'autres appareils électroniques chez vous ou au sein de votre entreprise. Les modèles de cette gamme offrent une alimentation de secours durant les coupures de courant et les fluctuations de tension dangereuses ainsi qu\'une protection contre les surtensions et les pics de tension. Ces modèles sont disponibles sous forme de tour ou de plancher. Associés à toute une gamme de fonctionnalités standard, ils constituent le choix idéal pour la protection de vos données tout en vous permettant de rester connecté.', 'gamme-apc-back-ups', 'Onduleurs Off-line APC Back UPS', 'onduleurs,onduleur,apc,backup ups, offline', 'La gamme d\'onduleur APC Back-UPS ES fait partie des gammes d\'onduleurs de type offline.'),
	(66, 1, 2, 'APC Back-UPS Pro', 'La gamme APC Back-UPS Pro offre une protection de l\'alimentation garantie pour les systèmes informatiques, les routeurs/modems, les périphériques de stockage externes, les consoles de jeux, ainsi que d\'autres appareils électroniques hautes performances chez vous ou au sein de votre entreprise. Les modèles de cette gamme offrent une alimentation de secours par batterie abondante durant les coupures de courant et stabilisent les fluctuations de tension dangereuses. Ils fournissent une protection contre les dommages causés par les surtensions et les pics de tension et permettent l\'utilisation d\'un logiciel de gestion afin d\'optimiser votre unité. Les principales fonctionnalités de cette gamme incluent la régulation automatique de la tension, un écran LCD et des fonctions d\'économie d\'énergie permettant de réduire l\'utilisation de l\'électricité. Associées aux autres fonctionnalités standard des Back-UPS Pro, elles constituent le choix idéal pour la protection de vos données tout en maintenant la disponibilité de votre système.', 'gamme-apc-back-ups-pro', 'Onduleurs Line-interactive APC Back-UPS Pro', 'onduleurs,onduleur,apc,APC Back-UPS Pro,line-interactive', 'La gamme d\'onduleurs APC Back-UPS Pro fait partie des gammes d\'onduleurs de type line-interactive'),
	(67, 1, 2, 'APC Smart UPS', 'Avec plus de 20 millions d\'unités vendues – l\'onduleur sur lequel vous pouvez compter\r\nL\'onduleur Smart-UPS® APC déjà récompensé constitue la solution de protection la plus populaire au monde pour les serveurs, dispositifs de stockage et réseaux. Réputé protéger les données et équipements sensibles des problèmes d\'alimentation en assurant une alimentation propre et fiable de qualité réseau. Outre leur légendaire fiabilité et facilité de gestion, les onduleurs Smart-UPS qui se caractérisent par une efficacité élevée à des niveaux de charge bas, moyens et élevés, s\'avèrent idéalement adaptés aux serveurs actuels multicœur ou virtualisés à la consommation de charge variable. Disponible pour diverses configurations de forme (tour, rack, convertible rack/tour), il existe un modèle pour chaque application et budget. Les onduleurs Smart-UPS à monter en rack conviennent idéalement pour l\'alimentation des serveurs lame ou à densité optimisée dans un environnement à protection d\'alimentation distribuée, en tant que protection primaire ou redondante. Les modèles Smart-UPS® ont longtemps été considérés comme référence universelle en matière d\'onduleurs réseau et serveur. Les onduleurs Smart-UPS présentent un écran à LED à 16 segments, des fonctionnalités de contrôle continu de la tension de plage étendue (Module d\'intelligence AVR) ainsi qu\'une sortie sinusoïdale pure sur batterie. Des options de facilité de gestion additionnelles peuvent être disponibles par le biais de l\'interface Smart-Slot, qui constitue un emplacement interne pour l\'installation de cartes accessoires optionnelles. L\'onduleur Smart-UPS XL à durée d\'autonomie étendue offre la possibilité d\'ajouter des packs de batterie externes pour faire évoluer la durée d\'autonomie de quelques minutes à plusieurs heures afin de satisfaire aux besoins courants des réseaux convergents voix et données. L\'onduleur Smart-UPS SC entrée de gamme constitue un choix économique pour les petites et moyennes entreprises qui souhaitent protéger de petits équipements tels que commutateurs, dispositifs réseau et équipements de points de vente (POS).', 'gamme-apc-smart-ups', 'Onduleurs Line-interactive APC Smart UPS', 'onduleurs,onduleur,APC,Smart UPSo,line-interactive', 'La gamme d\'onduleurs APC Smart UPS fait partie des gammes d\'onduleurs de type line-interactive'),
	(68, 1, 2, 'RIELLO Net Power', 'La série Net Power est disponible dans les modèles 600-800VA à technologie Line Interactive (VI) numérique: la charge est alimentée par le réseau qui, lorsqu’il est présent, est stabilisé en amplitude par le dispositif de réglage automatique (AVR) et filtré contre les surtensions par les filtres EMI.En cas de coupure d’alimentation du réseau, la charge est alimentée sur onduleur par une onde pseudo sinusoïdale pendant des périodes limitées mais suffisantes pour la clôture des systèmes informatiques par le logiciel PowerShield³.', 'gamme-riello-net-power', 'Onduleurs Line-interactive RIELLO Net Power', NULL, NULL),
	(69, 1, 2, 'RIELLO Vision Dual', 'La série VISION DUAL ( tour ou rack) comprends les modèles de 1100VA à 3000VA.\r\nLa série VISION DUAL, avec une connectivité et une communication évoluée, est la solution idéale pour les clients les plus exigeants qui ont besoin d\'un système d\'alimentation qui offre une protection supérieure pour les charges critiques – en tour ou en rack pour des serveurs, du matériel réseau ou des systèmes de stockage.\r\nLe Vision Dual possède un design moderne, avec un large choix de format , et représente la technologie state-of-the-art développé par le service recherche et développement de Riello UPS.\r\nL\'onduleur peut atteindre un rendement de 98% ,et, a un facteur de puissance de sortie de 0,9.', 'gamme-riello-vision-dual', 'Onduleurs Line-interactive RIELLO Vision Dual', NULL, NULL),
	(70, 1, 2, 'Eaton 9PX', 'Nouvel onduleur Eaton 9PX : pour maximiser efficacité énergétique, fiabilité et performance, même en environnement virtuel', 'gamme-eaton-9px', 'Gamme Eaton 9PX', NULL, 'Nouvel onduleur Eaton 9PX : pour maximiser efficacité énergétique, fiabilité et performance, même en environnement virtuel'),
	(71, 1, 2, 'Eaton 9SX', 'L’Eaton 9SX offre une haute disponibilité, flexibilité et une protection avancée pour les sites industriels, médicaux, réseaux de stockage & télécoms. Avec sa technologie On Line Double Conversion, il demeure versatile (Tour ou Rack) tout en offrant un rendement inégalé allant jusqu’à 95% !\r\n', 'gamme-eaton-9sx', 'Gamme Eaton 9SX', 'Gamme Eaton 9SX', 'L’Eaton 9SX offre une haute disponibilité, flexibilité et une protection avancée pour les sites industriels, médicaux, réseaux de stockage & télécoms.'),
	(72, 1, 2, 'APC Back-UPS CS', 'Le Back-UPS CS assure une protection électrique de qualité professionnelle pour les ordinateurs de bureau. Ses prises alimentées sur batterie et protégées contre les surtensions, sa protection intégrée des lignes téléphone/fax/modem (compatibles ADSL) et son logiciel d\'arrêt sécurisé du système doté de fonctions de gestion de l\'alimentation sophistiquées et de témoins d\'état audio-visuels proactifs garantissent que les systèmes sont protégés contre les surtensions, les pics de tension et les coupures totales.  L\'accès facile à une batterie échangeable à chaud et remplaçable par l\'utilisateur facilite la maintenance du Back-UPS CS. Ces caractéristiques, associées à son design classique, font du Back-UPS CS le choix idéal pour la protection de vos systèmes professionnels et de bureau.La connectivité série ou USB offre une plus grande souplesse aux utilisateurs, ce qui facilite et accélère l\'installation.', 'gamme-apc-back-ups-cs', 'Onduleurs offline APC Back-UPS CS', 'APC Back-UPS CS, onduleur, protection, offline', 'La gamme d\'onduleur APC Back-UPS CS fait partie des gammes d\'onduleurs de type offline'),
	(73, 1, 2, 'Gamme EATON protection Strip', 'L\'EATON Protection Strip offre une protection fiable de l\'alimentation des ordinateurs domestiques et de bureau ou de l\'équipement électronique de la maison ou des petites entreprises.', 'gamme-eaton-protection-strip', NULL, 'EATON, protection Strip, parasurtenseur, parafoudre', 'EATON, protection Strip, parasurtenseur, parafoudre'),
	(74, 1, 2, 'Capteurs / senseurs', NULL, 'capteurs-senseurs', NULL, NULL, NULL),
	(75, 1, 2, 'produits non testés', NULL, 'produits-non-testes', NULL, NULL, NULL),
	(76, 1, 2, 'Infosec Z1 zenergy cube', 'Avec sa technologie Haute fréquence, l\'onduleur Z1 Zenergy Cube est parfait pour des ordinateurs (PC ou Mac). Avec ses 3 prises secourues, il offre une autonomie pouvant aller jusqu\'à 11 minutes en cas de coupure ou microcoupure de courant.\r\n\r\nProtection Surtension / Court-circuit / Foudre - Alarmes sonores et led de fonctionnement - Assurance de l’équipement connecté à hauteur de 120 000 euros - Garantie 2 ans', 'gamme-infosec-z1-zenergy-cube', 'Infosec Z1 zenergy cube', 'Infosec Z1 zenergy cube, infosec, onduleur, onduleurs,ups,offline,off line,off-line', 'Tous les onduleurs Infosec Z1 zenergy cube 400'),
	(77, 1, 2, 'Infosec Z3 Zenergy Box', 'Avec son design moderne et compact, la gamme d\'onduleurs Z3 Zenergy Box s\'intègre avec élégance dans votre espace multimédia privé. Elle a été conçue pour offrir à vos PC et équipements de loisirs numériques une protection adaptée. ', 'gamme-infosec-z3-zenergy-box', 'Gamme Infosec Z3 Zenergy Box', 'Infosec Z3 Zenergy Box', 'Gamme Infosec Z3 Zenergy Box'),
	(78, 1, 2, 'Infosec Z4 B-box2', 'Les onduleurs Z4 B-box2 offrent une protection professionnelle à vos équipements de loisirs numériques et à votre box ADSL/Internet. Sa technologie Haute Fréquence contrôlée par microprocesseur garantit une protection complète.', 'gamme-infosec-z4-b-box2', 'Gamme Infosec Z4 B-box2', 'Infosec Z4 B-box2', 'Gamme Infosec Z4 B-box2'),
	(79, 1, 2, 'Infosec X1', 'La gamme d’onduleurs X1 a été conçue pour protéger votre informatique\r\npersonnelle et professionnelle (TPE) contre les problèmes d’alimentation\r\net les perturbations électriques dangereuses.', 'gamme-infosec-x1', 'Gamme Infosec X1', 'Gamme Infosec X1', 'Gamme Infosec X1'),
	(80, 1, 2, 'Infosec X2', 'La gamme d\'onduleurs X2 a été conçue pour protéger votre informatique personnelle et professionnelle (TPE). Sa technologie Line Interactive et son système de régulation de tension garantissent la distribution d\'un courant propre et régulier. Disponible en 4 ou 6 prises (modèle 1500 VA) IEC ou Nema.', 'gamme-infosec-x2', 'Gamme Infosec X2', 'Gamme Infosec X2', 'Gamme Infosec X2'),
	(81, 1, 2, 'Infosec X3', 'Sa technologie Line Interactive et son système de régulation automatique garantissent une protection de qualité. Disponible en 4 ou 6 prises (selon modèle) IEC ou Nema.', 'gamme-infosec-x3', 'Gamme Infosec X3', 'Gamme Infosec X3', 'Gamme Infosec X3'),
	(82, 1, 2, '10 KVA - grande puissance', 'Retrouvez ici tous les gammes d\'onduleurs dont la puissance est supérieur à 10K VA.', 'grande-puissance', 'Onduleurs supérieurs à 10K VA', NULL, 'Retrouvez ici tous les gammes d\'onduleurs dont la puissance est supérieur à 10K VA.'),
	(83, 1, 2, 'Infosec X4 RT', 'La gamme d\'onduleurs X4 RT est parfaite pour protéger l\'alimentation des équipements informatiques et vos données contre les dommages occasionnées par les perturbations électriques.', 'gamme-infosec-x4-rt', 'Gamme Infosec X4 RT', 'Gamme Infosec X4 RT', 'Gamme Infosec X4 RT'),
	(84, 1, 2, 'Infosec X4 SINUS RT', 'Technologie Line Interactive sortie sinus contrôlée par microprocesseur, l\'onduleur X4 SINUS RT est adapté à la protection électrique de vos réseaux et charges informatiques contre les problèmes d\'alimentation et les perturbations électriques.', 'gamme-infosec-x4-sinus-rt', 'Gamme Infosec X4 SINUS RT', 'Gamme Infosec X4 SINUS RT', 'Gamme Infosec X4 SINUS RT'),
	(85, 1, 2, 'Infosec E2 LCD', 'Les onduleurs de la gamme des E2 LCD protégent vos réseaux et applications informatique et économiser l\'énergie. La technologie On Line Performance et le système de régulation automatique de la tension garantissent une protection fiable et performante avec cet onduleur. Disponible en 4 ou 6 prises IEC (selon modèle).', 'gamme-infosec-e2-lcd', 'Gamme Infosec E2 LCD', 'Gamme Infosec E2 LCD', 'Gamme Infosec E2 LCD'),
	(86, 1, 2, 'Infosec E3 LCD RT', 'Equipée d\'une technologie On Line Performance dont le contrôl est assuré par miccroprocesseur, la gamme d\'onduleur E3 LCD RT protège idéalement les réseaux informatique, et installations informatiques en leur délivrant un parfait courant sinusoïdal entièrement protégé sur ses prises.', 'gamme-infosec-e3-lcd-rt', 'Gamme Infosec E3 LCD RT', 'Gamme Infosec E3 LCD RT', 'Gamme Infosec E3 LCD RT'),
	(87, 1, 2, 'EBM - Extension d\'autonomie', 'Modules de batterie - Extension d\'autonomie jusqu\'à 30 minutes et plus selon la charge connectée.', 'modules-de-batterie-extension-d-autonomie', 'Modules de batterie - Extension d\'autonomie', 'Modules de batterie - Extension d\'autonomie', 'Modules de batterie - Extension d\'autonomie'),
	(89, 1, 2, 'APC', 'American Power Conversion, offre une protection contre l\'une des principales causes de perte de données, de dégâts matériels et d\'interruption systèmes : les problèmes d\'alimentation électrique.\r\n\r\nL\'offre d\'APC s\'articule autours de plusieurs gammes : \r\n- Back-UPS ES\r\n- Back-UPS CS\r\nCes deux gammes sont des onduleurs de types onduleur Offline.\r\n\r\n- APC Smart UPS\r\n- APC Smart UPS SC\r\n- APC Back-UPS Pro\r\nCes trois gammes correspondent a des onduleurs de type Line-interactive.', 'apc', 'Onduleurs APC by Schneider Electric', 'APC,schneider electric, onduleur APC, American Power Conversion, offline, line-interactive, smart ups, back-up ups', 'American Power Conversion, offre une protection contre l\'une des principales causes de perte de données, de dégâts matériels et d\'interruption systèmes : les problèmes d\'alimentation électrique.'),
	(90, 1, 2, 'EATON Powerware', 'Eaton est un fournisseur mondial majeur de solutions de protection électrique dont le but est assurer à ses clients une disponibilité de leurs équipements très proche de 100%. Sa famille Powerware propose une très large gamme de produits et services. \r\n\r\nClassée numéro 1 mondial des onduleurs de puissance supérieure à 5 kVA et numéro 2 pour les puissances inférieures, la ligne de produits Powerware a gagné la confiance de clients de toutes tailles dans le monde entier.\r\n\r\nLes onduleurs Powerware sont regroupés en différentes gammes :\r\n\r\n- 3S\r\nGamme d\'onduleur Offline.\r\n\r\n- 5110\r\n- 5115\r\n- 5115 RM\r\n- 5130\r\nGammes d\'onduleur Line-interactive.\r\n\r\n- 9130\r\n- 9130 RM\r\n- 9135\r\n- 9140\r\nGammes d\'onduleur Online.', 'eaton-powerware', 'Onduleurs EATON Powerware', 'EATON Powerware, onduleur, offline,line-interactive, online', 'Eaton est un fournisseur mondial majeur de solutions de protection électrique dont le but est assurer à ses clients une disponibilité de leurs équipements très proche de 100%'),
	(91, 1, 2, 'EATON Pulsar', '', 'eaton-pulsar', 'EATON Pulsar - Fabricant d onduleurs', 'EATON Pulsar', ''),
	(92, 1, 2, 'Infosec UPS System', 'INFOSEC Communication SA, société française, fabrique et commercialise sur la scène internationale des onduleurs et parasurtenseurs depuis plus de 20 ans.', 'infosec-ups-system', 'Infosec UPS System', 'Infosec UPS System', ''),
	(93, 1, 2, 'Riello UPS', 'Grâce à Riello UPS, la société Riello Elettronica se place aujourd\'hui parmi les quatre premiers producteurs mondiaux de groupes de continuité, avec une gamme complète d\'ASI en mesure de satisfaire n\'importe quel besoin en énergie, du plus petit ordinateur aux plus grands systèmes bancaires, hospitaliers et aéroportuaires, pour lesquels la continuité opérationnelle représente une\r\ncondition essentielle. ', 'riello-ups', 'Riello UPS', 'Riello UPS', ''),
	(94, 1, 2, 'Root', NULL, '', NULL, NULL, NULL);
