INSERT INTO `ps_cms_lang` (`id_cms`, `id_lang`, `meta_title`, `meta_description`, `meta_keywords`, `content`, `link_rewrite`) VALUES
	(7, 2, 'Les différents problèmes électriques et leur solution', 'Il existe neufs problèmes électriques courants. Nous vous aidons à trouver la solution la plus adaptée à vos problèmes.', 'problèmes électriques, coupure réseau, creux de tension, surtension, baisse de tension, hausse de tension, distorsion transitoire, bruit de ligne,variation de fréquence,distorsion harmonique', '', 'problemes-electriques'),
	(2, 2, 'Mentions légales', 'Mentions légales', 'mentions, légales, crédits', '<h2>Mentions légales</h2>\r\n<h3 style="margin-top: 0.75em; margin-right: 0px; margin-bottom: 0.3em; margin-left: 0px; font-size: 16px; outline-width: 0px; outline-style: initial; outline-color: initial; font-weight: inherit; font-style: inherit; font-family: inherit; vertical-align: baseline; color: #374853; padding: 0px; border: 0px initial initial;">S.A.R.L. OXALION</h3>\r\n<p>Société anonyme à responsabilité limitée immatriculée au R.C.S. de LYON sous le numéro 528 697 733 <br /><span style="text-decoration: underline;">Adresse </span>: Résidence de la Croix-Rousse - 3, rue Dangon - 69004 LYON - FRANCE </p>\r\n<p><span style="text-decoration: underline;">N° de Siret </span>: 52869773300012 <br /><span style="text-decoration: underline;">Code APE-NAF</span> : 4791B</p>\r\n<p> Le présent site et l’ensemble des éléments y figurant (informations, données, texte, sons, images, dessins, graphismes, signes distinctifs, logos, marques,…) sont la propriété exclusive de OXALION SARL. L’ensemble de ces éléments est soumis aux dispositions du Code de la propriété intellectuelle et, à ce titre, est protégé contre toute utilisation non autorisée par la loi.</p>', 'mentions-legales'),
	(3, 2, 'Conditions d\'utilisation', 'Nos conditions générales de ventes', 'conditions, utilisation, générales, ventes', '<div style="background-color: transparent; font-family: \'Times New Roman\'; font-size: medium;">\r\n<p id="internal-source-marker_0.06671341927722096" style="text-align: center; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Conditions g&eacute;n&eacute;rales de vente (CGV OXALION SARL)</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /></span><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Article 1: Objet</span></p>\r\n<p style="margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Les pr&eacute;sentes conditions g&eacute;n&eacute;rales de vente ont pour objet de r&eacute;gir de mani&egrave;re exclusive l\'ensemble<br />des relations contractuelles entre la S.A.R.L. OXALION (dont le si&egrave;ge social est &agrave; R&eacute;sidence de la Croix-Rousse - 3, rue Dangon - 69004 LYON - FRANCE, immatricul&eacute;e au R.C.S. de LYON sous le num&eacute;ro 528 697 733) ci-apr&egrave;s d&eacute;nomm&eacute;e "l&rsquo;entreprise", et d\'autre part, par toute personne physique ou morale d&eacute;nomm&eacute;e ci-apr&egrave;s "Client" souhaitant proc&eacute;der &agrave; un achat via les sites internet de la S.A.R.L. OXALION: &ldquo; www.mononduleur.fr; www.mononduleur.com, www.oxalion.fr, www.oxalion.com", ci-apr&egrave;s d&eacute;nomm&eacute; "le Site".</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /></span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="text-decoration: underline;">D&eacute;signation du vendeur</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">S.A.R.L. OXALION</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Soci&eacute;t&eacute; anonyme &agrave; responsabilit&eacute; limit&eacute;e &nbsp;immatricul&eacute;e au R.C.S. de LYON sous le num&eacute;ro 528 697 733</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Adresse : R&eacute;sidence de la Croix-Rousse - 3, rue Dangon - 69004 LYON - FRANCE</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">N&deg; de Siret: 452869773300012</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Code APE-NAF: 4791B</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /><br /></span><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Article 2: Champ d\'application et acceptation</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Les pr&eacute;sentes conditions g&eacute;n&eacute;rales de vente sont applicables &agrave; l\'ensemble des articles propos&eacute;s &agrave; la vente sur le Site, et sont r&eacute;serv&eacute;s aux Clients de plus de 18 ans qui d&eacute;tiennent la pleine capacit&eacute; juridique.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">L\'acquisition d\'un bien ou d\'un service &agrave; travers le Site implique une acceptation sans r&eacute;serve par le Client des pr&eacute;sentes conditions g&eacute;n&eacute;rales de vente. Ces conditions g&eacute;n&eacute;rales de vente pr&eacute;vaudront sur toutes autres conditions g&eacute;n&eacute;rales ou particuli&egrave;res non express&eacute;ment agr&eacute;&eacute;es par la SARL OXALION.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Tout manquement, de la part de la SARL OXALION &agrave; l\'une de ses obligations &eacute;voqu&eacute;es dans les pr&eacute;sentes conditions g&eacute;n&eacute;rales de vente, ne pourra en aucun cas &ecirc;tre interpr&eacute;t&eacute; par le Client, comme une renonciation aux conditions g&eacute;n&eacute;rales de vente. Lesdites conditions pourront faire l\'objet de mises &agrave; jour ou de modifications sans pr&eacute;avis. Les conditions applicables seront alors, celles en vigueur au moment de la conclusion du contrat, c\'est &agrave; dire le jour de l\'enregistrement de la commande. Le Client peut consulter simplement, librement et &agrave; tout moment ces conditions g&eacute;n&eacute;rales de vente en &nbsp;cliquant sur le lien C.G.V. "conditions g&eacute;n&eacute;rales de vente" dans un format informatique permettant son impression ou sa sauvegarde.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /></span><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Article 3: Les articles</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="text-decoration: underline;">Disponibilit&eacute;:<br /></span><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Les articles et offres promotionnelles propos&eacute;s par la SARL OXALION ne le sont que dans la limite des stocks disponibles et pour les offres, jusqu\'au terme de leur validit&eacute;. Les d&eacute;lais mentionn&eacute;s lors de la passation de commande le sont &agrave; titre indicatif et d&eacute;pendent notamment des propres d&eacute;lais des fournisseurs et/ou fabricants. Dans ces conditions, l\'indisponibilit&eacute; d&eacute;finitive ou le report &eacute;ventuel de ces d&eacute;lais de disponibilit&eacute; ne saurait en aucun cas engager la responsabilit&eacute; de la SARL OXALION, pas plus qu\'elle ne saurait ouvrir un quelconque droit &agrave; l\'indemnisation ou dommages et int&eacute;r&ecirc;ts en faveur du consommateur. En cas d\'indisponibilit&eacute; temporaire d\'un produit, SARL OXALION fera son possible pour informer l\'acheteur par courrier &eacute;lectronique et lui proposer le remboursement ou l\'&eacute;change contre un autre article de prix &eacute;quivalent, selon le souhait de l\'acheteur.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /></span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="text-decoration: underline;">Conformit&eacute;:<br /></span><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Les articles propos&eacute;s &agrave; la vente par la SARL OXALION sont conformes aux normes applicables en France. Notre responsabilit&eacute; ne saurait &ecirc;tre engag&eacute;e en cas de non respect de la l&eacute;gislation du pays o&ugrave; sont livr&eacute;s les articles. Il appartient au Client de v&eacute;rifier aupr&egrave;s des autorit&eacute;s locales les possibilit&eacute;s d\'importation ou d\'utilisation des articles ou services que celui-ci envisage de commander. La SARL OXALION marque sa volont&eacute; d\'&ecirc;tre le plus pr&eacute;cis et de respecter au mieux la r&eacute;alit&eacute; des produits. Les &eacute;l&eacute;ments tels que photographies, graphismes, textes et les informations accompagnant les articles ne sont pas contractuels. De ce fait, nous ne pouvons pas &ecirc;tre tenus responsables des modifications &eacute;ventuelles des produits pr&eacute;sent&eacute;s, ceux-ci pouvant &ecirc;tre modifi&eacute;s par les Fabricants et ce sans pr&eacute;avis. Le choix et l\'achat des articles sont de la responsabilit&eacute; du Client. L\'impossibilit&eacute; d\'utiliser l\'article achet&eacute; pour quelque cause que ce soit, n\'engage pas la responsabilit&eacute; de la SARL OXALION.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /></span><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Article 4: Les prix</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Les prix indiqu&eacute;s sur le Site, sont en euros et s\'entendent toutes taxes comprises (TVA fran&ccedil;aise incluse). Tout changement &eacute;ventuel du taux l&eacute;gal de la TVA fran&ccedil;aise sera r&eacute;percut&eacute; sur le prix des articles pr&eacute;sent&eacute;s sur le site. Les prix n\'int&egrave;grent pas les frais de port et d\'emballage qui sont &agrave; la charge du Client et qui lui seront pr&eacute;cis&eacute;s sur le bon de commande. Les prix indiqu&eacute;s pourront &ecirc;tre modifi&eacute;s par la SARL OXALION, &agrave; tout moment, notamment en raison d\'offres de lancement, de promotions ou de soldes.</span></p>\r\n<span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">&nbsp;</span><br />\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Article 5: Le contrat</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Dans tous les cas, le contrat de vente n\'est consid&eacute;r&eacute; conclu et d&eacute;finitif qu&rsquo;&agrave; la date de r&eacute;ception du paiement dans son int&eacute;gralit&eacute;.</span></p>\r\n<br />\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /></span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="text-decoration: underline;">Prise de commande:</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Les commandes s\'effectuent sur le Site. Si le Client souhaite passer commande, il remplira, selon les indications qui lui sont fournies en ligne, un formulaire mis &agrave; sa disposition o&ugrave; il fera figurer les informations n&eacute;cessaires &agrave; son identification et notamment ses: nom, pr&eacute;nom, adresse postale, n&deg; de t&eacute;l&eacute;phone, e-mail et adresse de livraison.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /></span><span style="text-decoration: underline;">Validation de commande:</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Les articles mis en vente sont accompagn&eacute;s d\'un descriptif. </span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Le consommateur souhaitant acheter un de ces articles doit suivre la proc&eacute;dure suivante&nbsp;: </span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">choisir son article; ajouter l&rsquo;article &agrave; son panier; valider le panier; le montant total de la commande s&rsquo;affichera en bas du bon, tout comme le co&ucirc;t du transport.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Ce bon de commande sera alors &agrave; envoyer soit par mail &agrave; l&rsquo;adresse suivante&nbsp;: commande@mononduleur.fr soit par courrier &agrave; l&rsquo;adresse suivante&nbsp;: SARL OXALION - R&eacute;sidence de la Croix-Rousse - 3, rue Dangon - 69004 LYON - FRANCE.. D&egrave;s cet instant, la commande est enregistr&eacute;e et est irr&eacute;vocable de sa part. Toute commande pass&eacute;e aupr&egrave;s de la SARL OXALION, par l\'interm&eacute;diaire d&rsquo;un de ses sites internet, sera confirm&eacute;e au Client par l\'envoi d\'une confirmation de commande assign&eacute;e d\'un num&eacute;ro de commande et ce, dans les meilleurs d&eacute;lais par courrier &eacute;lectronique. Par ailleurs, nous conseillons aux Clients qui commandent directement sur son site internet d\'enregistrer ou d\'imprimer une copie du bon de commande jusqu\'&agrave; r&eacute;ception de l\'e-mail de confirmation de commande adress&eacute; au Client par la SARL OXALION. Aucune annulation de commande ne sera accept&eacute;e sans l\'accord pr&eacute;alable de la SARL OXALION. La r&eacute;ception du paiement validera la commande.</span></p>\r\n<br />\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="text-decoration: underline;">Paiement</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 8pt; font-family: Verdana; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Le r&egrave;glement de vos achats s\'effectue :</span></p>\r\n<p style="margin-left: 44pt; text-indent: -18pt; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">&middot; &nbsp;&nbsp;&nbsp;</span><span style="text-decoration: underline;">Paiement</span><span style="font-size: 8pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"> </span><span style="text-decoration: underline;">Paypal</span><span style="font-size: 8pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"> :</span></p>\r\n<span style="font-size: 8pt; font-family: Verdana; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Paiement GRATUIT et SECURISE par carte bancaire.</span><br />\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 8pt; font-family: Verdana; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">La transaction s&eacute;curis&eacute;e s\'effectue apr&egrave;s la validation de la commande.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 8pt; font-family: Verdana; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Votre commande sera trait&eacute;e et exp&eacute;di&eacute;e juste apr&egrave;s sa validation</span><span style="font-size: 9pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"> </span></p>\r\n<p style="margin-left: 44pt; text-indent: -18pt; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">&middot; &nbsp;&nbsp;&nbsp;</span><span style="text-decoration: underline;">Ch&egrave;que bancaire ou postal</span><span style="font-size: 8pt; font-family: Verdana; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"> :</span></p>\r\n<span style="font-size: 8pt; font-family: Verdana; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Apr&egrave;s avoir valid&eacute; votre commande sur notre site, vous nous exp&eacute;diez votre ch&egrave;que par courrier en pr&eacute;cisant la r&eacute;f&eacute;rence de votre commande indiqu&eacute;e dans l\'email de confirmation.</span><br />\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 8pt; font-family: Verdana; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Votre commande sera exp&eacute;di&eacute;e &agrave; l\'encaissement du ch&egrave;que.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 8pt; font-family: Verdana; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">En cas de paiement par ch&egrave;que bancaire, celui-ci doit &ecirc;tre &eacute;mis par une banque domicili&eacute;e en France. L\'envoi de votre r&egrave;glement par ch&egrave;que doit se faire sous 5 jours ouvrables, toute commande dont le ch&egrave;que n\'est pas envoy&eacute; sous 5 jours sera annul&eacute;e.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 8pt; font-family: Verdana; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">L\'encaissement du ch&egrave;que est r&eacute;alis&eacute; &agrave; la r&eacute;ception du ch&egrave;que. Le ch&egrave;que sera &agrave; envoyer </span><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">&nbsp;&agrave; l \'adresse suivante : SARL OXALION &ndash; R&eacute;sidence de la Croix-Rousse - 3, rue Dangon - 69004 LYON - FRANCE. Le ch&egrave;que sera d&eacute;pos&eacute; en banque, pour encaissement, d&egrave;s sa r&eacute;ception.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"> &nbsp;&nbsp;&nbsp;</span><span style="text-decoration: underline;">Virement bancaires:</span></p>\r\n<br />\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Article 6: La livraison</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /></span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="text-decoration: underline;">Zone de livraison:</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Nous exp&eacute;dions vos colis en </span><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><strong>France M&eacute;tropolitaine</strong></span><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">. La SARL OXALION se r&eacute;serve le droit de choisir le mode de transport ad&eacute;quat. </span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /></span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="text-decoration: underline;">Les informations:</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Les articles seront livr&eacute;s du lundi au vendredi, sauf jours f&eacute;ri&eacute;s, &agrave; l\'adresse indiqu&eacute;e par le Client lors du passage de sa commande. De ce fait, les coordonn&eacute;es transmises par le Client sont consid&eacute;r&eacute;es comme &eacute;tant exactes et n\'engageront pas, en cas de litige, la responsabilit&eacute; de la SARL OXALION. Le colis est remis contre signature, cette signature nous garantit mutuellement du bon acheminement du colis. En cas d\'absence du Client au moment de la livraison, un avis de passage sera d&eacute;pos&eacute; dans sa bo&icirc;te aux lettres l\'invitant &agrave; retirer son colis &agrave; la poste ou chez le transporteur.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /></span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="text-decoration: underline;">D&eacute;lai de livraison:</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Le d&eacute;lai de livraison moyen est de 21 jours. Il est indiqu&eacute; seulement &agrave; titre indicatif et ne constitue pas un engagement ferme de notre part. Le prix sera indiqu&eacute; sur votre facture. Toute vente &agrave; destination d\'un pays autre que la France m&eacute;tropolitaine met le Client en situation d\'importateur. En cons&eacute;quence, le Client assurera sous son unique responsabilit&eacute; l\'entr&eacute;e des articles dans le territoire de destination, effectuera l\'ensemble des d&eacute;marches n&eacute;cessaires, et prendra &agrave; sa charge toutes taxes, droits de douane ou d\'importation et plus g&eacute;n&eacute;ralement les sommes &agrave; payer y aff&eacute;rents.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /></span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="text-decoration: underline;">R&eacute;ception des produits:</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">La SARL OXALION vous conseille de v&eacute;rifier imm&eacute;diatement l\'&eacute;tat des marchandises re&ccedil;ues et leur conformit&eacute; par rapport &agrave; la commande. Une fois le bon sign&eacute;, la SARL OXALION consid&eacute;rera que le Client a effectu&eacute; cette v&eacute;rification. Dans le cas o&ugrave; le colis serait trop endommag&eacute;, l\'acheteur se doit de refuser le colis et le faire constater par la poste ou le transporteur.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /></span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Article 7: Conformit&eacute; et garanties des produits:</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Toutes les r&eacute;clamations relatives &agrave; une inexactitude dans la quantit&eacute;,&nbsp; &agrave; un d&eacute;faut des marchandises livr&eacute;es, o&ugrave; &agrave; la confirmation de commande par le vendeur, doivent &ecirc;tre formul&eacute;es par &eacute;crit dans un d&eacute;lai de 48 heures &agrave; r&eacute;ception des marchandises. Pass&eacute; ce d&eacute;lai, la r&eacute;clamation ne pourra aboutir. En cas de non conformit&eacute; des articles, nous demandons au Client de nous en informer par courrier avant son envoi, donnant lieu &agrave; un accord pr&eacute;alable de sa part. Le retour devra &ecirc;tre effectu&eacute; dans les 8 jours ouvr&eacute;s suivants celui-ci par Colissimo Recommand&eacute; &agrave; la charge du Client &agrave;: SARL OXALION &ndash; R&eacute;sidence de la Croix-Rousse - 3, rue Dangon - 69004 LYON - FRANCE. Les articles seront retourn&eacute;s en int&eacute;gralit&eacute;, en parfait &eacute;tat et dans leur emballage d\'origine.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /></span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><span style="text-decoration: underline;">Garanties:</span></span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Dans tous les cas, la SARL OXALION ne pourra &ecirc;tre tenue pour responsable pour non respect des dispositions r&eacute;glementaires et l&eacute;gislatives en vigueur dans le pays de r&eacute;ception, la responsabilit&eacute; de la SARL OXALION &eacute;tant syst&eacute;matiquement limit&eacute;e &agrave; la valeur du produit mis en cause, valeur &agrave; sa date de vente et ce sans possibilit&eacute; de recours envers la marque ou la soci&eacute;t&eacute; productrice du produit. Le Client b&eacute;n&eacute;ficie des dispositions l&eacute;gales, relatives &agrave; la garantie des vices cach&eacute;s en vertu de l\'article 1641 et suivants du code civil. </span></p>\r\n<br />\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Article 8: R&eacute;serve de propri&eacute;t&eacute; et Clause r&eacute;solutoire</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Les articles command&eacute;s demeurent la propri&eacute;t&eacute; de la SARL OXALION, jusqu\'&agrave; ce que le Client remplisse ses obligations, notamment qu\'il s\'acquitte du paiement int&eacute;gral du prix. Une fois le transfert de propri&eacute;t&eacute; effectu&eacute;, les risques de perte, de vol ou de d&eacute;t&eacute;rioration des produits sont &agrave; la charge du Client. En cas de manquement, de la part de l\'acheteur, &agrave; l\'une de ses obligations, la vente sera r&eacute;sili&eacute;e de plein droit et sans sommation. Les produits devront &ecirc;tre restitu&eacute;s &agrave; la SARL OXALION sous un d&eacute;lai de 48 heures.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /></span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Article 9: Droit de r&eacute;tractation:</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Le Client dispose d\'un d&eacute;lai de r&eacute;tractation&nbsp; de 7 jours francs en vertu des dispositions des articles L.121-20 et suivants du Code de la Consommation, pour exercer son droit de r&eacute;tractation sans avoir &agrave; justifier de motifs, &agrave; compter de la date de r&eacute;ception de sa commande. Les frais d\'envoi et de retour seront &agrave; la charge seule du Client. Les articles, accompagn&eacute;s d\'un RIB du Client, devront &ecirc;tre retourn&eacute;s par La Poste, dans un parfait &eacute;tat et dans leur emballage d\'origine ( y compris accessoires et notices) &agrave; l \'adresse suivante: la SARL OXALION &ndash; R&eacute;sidence de la Croix-Rousse - 3, rue Dangon - 69004 LYON - FRANCE. Les remboursements seront effectu&eacute;s par ch&egrave;que bancaire dans un d&eacute;lai de 15 jours. En cas de retour d\'un produit endommag&eacute;, incomplet ou ab&icirc;m&eacute;, celui-ci ne sera ni &eacute;chang&eacute; ni rembours&eacute;.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /></span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Article 10: Donn&eacute;es personnelles</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">La SARL OXALION est soucieuse de la protection de la vie priv&eacute;e du Client venant passer commande sur son site internet www.mon onduleur.fr. C\'est pourquoi, la SARL OXALION traite les informations le concernant avec la plus stricte confidentialit&eacute;. Ces donn&eacute;es ne sont fournies que dans le seul but de proc&eacute;der &agrave; la livraison des articles command&eacute;s sur le site www.mononduleur.fr, et sont rendues obligatoires en vue du traitement de leur commande et des v&eacute;rifications &eacute;ventuellement effectu&eacute;es afin de mieux lutter contre les fraudes. Conform&eacute;ment &agrave; la loi du 6 janvier 1978, relative &agrave; l\'informatique et aux libert&eacute;s, le Client dispose d\'un droit d\'acc&egrave;s et de restriction de ses donn&eacute;es personnelles. Ainsi, pour tout compl&eacute;ment ou rectification, il vous suffit de nous envoyer les nouvelles donn&eacute;es soit par courrier &eacute;lectronique &agrave; cette adresse: </span><span style="text-decoration: underline;">contact@mononduleur.fr</span><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">, soit par lettre &agrave; cette adresse: SARL OXALION &ndash; R&eacute;sidence de la Croix-Rousse - 3, rue Dangon - 69004 LYON - FRANCE. La SARL OXALION s\'engage &agrave; ne pas communiquer vos donn&eacute;es personnelles &agrave; des tiers, hormis les tiers charg&eacute;s de la v&eacute;rification des donn&eacute;es obligatoires fournies au moment de la commande.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /></span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Article 11: Responsabilit&eacute;</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">La SARL OXALION, dans le processus de vente en ligne, n\'est tenue que par une obligation de moyens, sa responsabilit&eacute; ne pourra &ecirc;tre engag&eacute;e pour un dommage r&eacute;sultant de l\'utilisation du r&eacute;seau Internet prenant pour exemple, pertes de donn&eacute;es, intrusion, virus, ou autres probl&egrave;mes involontaires.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /></span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Article 12: Clause d\'attribution de juridiction</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Tous diff&eacute;rents relatifs &agrave; la formation, l\'ex&eacute;cution et la cessation des obligations contractuelles entre les parties ne pouvant donner lieu &agrave; un r&egrave;glement &agrave; l\'amiable, seront soumis &agrave; la juridiction du Tribunal de Commerce de LYON dans le ressort duquel se trouve le si&egrave;ge du vendeur, quelque soient les conditions de vente et le mode de paiement accept&eacute;, m&ecirc;me en cas d\'appel en garantie ou de pluralit&eacute; des d&eacute;fendeurs, le vendeur se r&eacute;servant le droit de saisir le Tribunal territorialement comp&eacute;tent dont rel&egrave;ve le si&egrave;ge de l\'acheteur. Le pr&eacute;sent contrat est r&eacute;gi par la loi fran&ccedil;aise. En cas de litige, les tribunaux fran&ccedil;ais seront seuls comp&eacute;tents.</span></p>\r\n<p style="text-align: justify; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /></span></p>\r\n<span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Article 13: Droits d&rsquo;auteurs - Droits de reproduction<br /></span><span style="font-size: 10pt; font-family: \'Times New Roman\'; color: #333333; background-color: transparent; font-weight: normal; font-style: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Le Site rel&egrave;ve de la l&eacute;gislation fran&ccedil;aise et internationale sur le droit d\'auteur et la propri&eacute;t&eacute; intellectuelle. Tous les droits de reproduction y sont r&eacute;serv&eacute;s, y compris les repr&eacute;sentations iconographiques et photographiques.<br />La pr&eacute;sentation g&eacute;n&eacute;rale du site est originale et &eacute;galement prot&eacute;g&eacute;e. Vous n\'&ecirc;tes donc pas autoris&eacute; &agrave; reproduire le code html des pages de ce serveur dans le but de diffusion publique.<br />La reproduction de tout ou partie de ce site sur un support quel qu\'il soit, est formellement interdite sauf autorisation expresse du directeur de la publication.</span></div>', 'conditions-generales-de-ventes'),
	(5, 2, 'Paiement sécurisé', 'Notre offre de paiement sécurisé', 'paiement sécurisé, ssl, visa, mastercard, paypal', '<p>Paiement s&eacute;curis&eacute;<br /> Notre offre de paiement s&eacute;curis&eacute;<br /> <br /> Avec SSL<br /> Utilisation de Visa/Mastercard/Paypal<br /> <br /> Grace &agrave; PAYPAL vous pouvez r&eacute;gler par carte bancaire m&ecirc;me si vous ne possedez pas de compte PAYPAL.<br /> <br /> Cette solution est enti&egrave;rement s&eacute;curis&eacute;e. Aucune donn&eacute;e concernant vos identifiants bancaires ne transite par le site MonOnduleur.fr. Celles-ci sont trait&eacute;es directement par PAYPAL sur leur serveurs s&eacute;curis&eacute;s.<br /> <br /> <br /> REGLEMENT PAR CHEQUE<br /> <br /> Nous acceptons les r&egrave;glements par ch&egrave;que. Ceux ci sont encaiss&eacute;s &agrave; l\'exp&eacute;dition du produit command&eacute;. <br /> La r&eacute;ception du ch&egrave;que par MonOnduleur.fr est n&eacute;c&eacute;ssaire avant que nous puissions proceder &agrave; l\'exp&eacute;dition du produit.<br /> <br /> <br /> <br /> REGLEMENT PAR COMPTE PAYPAL<br /> <br /> Les r&egrave;glements &eacute;l&egrave;ctroniques effectu&eacute;s gr&acirc;ce &agrave; votre compte PAYPAL sont acceptes sur MonOnduleur.fr</p>', 'paiement-securise'),
	(6, 2, 'Les différentes applications par onduleur', 'Tableau de comparaison des différentes applications suivant le modèle d\'onduleur', 'comparaison onduleurs,applications onduleurs', '<p><span style="text-decoration: underline;"><strong>- Tout ce qu\'il faut savoir sur les onduleurs et leurs applications (cliquez sur le lien ci-dessous):<br /></strong></span><a href="http://www.changez-avec-eaton.fr/ressources/l-essentiel-sur-l-alimentation.aspx" target="_blank">http://www.changez-avec-eaton.fr/ressources/l-essentiel-sur-l-alimentation.aspx</a></p>\r\n<p><span style="text-decoration: underline;"><strong>Les différents probèmes éléctriques rencontrés <strong>(cliquez sur le lien ci-dessous)</strong>:<br /></strong></span><a href="http://www.changez-avec-eaton.fr/ressources/l-essentiel-sur-l-alimentation/neuf-problemes-electriques.aspx" target="_blank">http://www.changez-avec-eaton.fr/ressources/l-essentiel-sur-l-alimentation/neuf-problemes-electriques.aspx</a></p>\r\n<h2> <span style="font-size: 18px;">Onduleurs EATON : Applications possibles</span></h2>\r\n<p>Ci-dessous, un tableau récapitulatif des différentes applications possible suivant le modèle d\'onduleur.</p>\r\n<table id="applicationTable" border="0">\r\n<thead>\r\n<tr><th class="center" rowspan="2">Produit</th><th class="center" colspan="6">Application</th></tr>\r\n<tr class="even"><th>Grand Public et petites entreprises</th><th>IT et data centres</th><th>Télécom, VoiP</th><th>Systèmes de sécurité</th><th>Systèmes Industriels</th><th>Médical</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr class="even">\r\n<td><a href="/31-gamme-eaton-3s">Eaton 3S</a></td>\r\n<td class="center">X</td>\r\n<td> </td>\r\n<td> </td>\r\n<td> </td>\r\n<td> </td>\r\n<td> </td>\r\n</tr>\r\n<tr class="odd">\r\n<td><a href="/10-gamme-eaton-5110">Eaton 5110</a></td>\r\n<td class="center">X</td>\r\n<td> </td>\r\n<td> </td>\r\n<td> </td>\r\n<td> </td>\r\n<td> </td>\r\n</tr>\r\n<tr class="even">\r\n<td><a href="/11-gamme-eaton-5115">Eaton 5115</a></td>\r\n<td class="center"> </td>\r\n<td class="center">X</td>\r\n<td class="center">X</td>\r\n<td class="center">X</td>\r\n<td class="center"> </td>\r\n<td class="center">X</td>\r\n</tr>\r\n<tr class="odd">\r\n<td><a href="/12-gamme-eaton-5115-rm">Eaton 5115 RM</a></td>\r\n<td class="center"> </td>\r\n<td class="center">X</td>\r\n<td class="center">X</td>\r\n<td class="center">X</td>\r\n<td class="center"> </td>\r\n<td> </td>\r\n</tr>\r\n<tr class="even">\r\n<td><a href="/15-gamme-eaton-5130">Eaton 5130</a></td>\r\n<td class="center"> </td>\r\n<td class="center">X</td>\r\n<td class="center">X</td>\r\n<td class="center">X</td>\r\n<td class="center"> </td>\r\n<td class="center">X</td>\r\n</tr>\r\n<tr class="even">\r\n<td><a href="/21-gamme-eaton-9130-rm">Eaton 9130 RM</a></td>\r\n<td class="center"> </td>\r\n<td class="center">X</td>\r\n<td class="center">X</td>\r\n<td class="center">X</td>\r\n<td class="center">X</td>\r\n<td class="center">X</td>\r\n</tr>\r\n<tr class="odd">\r\n<td><a href="/13-gamme-eaton-9130">Eaton 9130</a></td>\r\n<td class="center"> </td>\r\n<td class="center">X</td>\r\n<td class="center">X</td>\r\n<td class="center">X</td>\r\n<td class="center">X</td>\r\n<td class="center">X</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'chercher-onduleur-par-application'),
	(8, 2, 'Téléchargements (Drivers & Logiciels)', '', '', '<p>En construction</p>', 'telechargement-drivers'),
	(9, 2, 'Enregistrement (Garanties)', 'Enregistrement produits garantie', 'enregistrement garantie EATON APC,garanties', '<p>Bonjour, nous vous remercions de votre confiance.<br />Afin d\'activer la garantie de votre produit, merci de bien vouloir l\'enregistrer en cliquant sur le lien suivant :</p>\r\n<ul>\r\n<li><strong>EATON </strong>: <a href="http://powerquality.eaton.com/France/Product-Registration/">http://powerquality.eaton.com/France/Product-Registration/</a></li>\r\n<li><strong>APC</strong> : <a href="https://www.apcc.com/warranty/inter_warranty/index.cfm?langcode=fr&amp;ISOCountryCode=FR">https://www.apcc.com/warranty/inter_warranty/index.cfm?langcode=fr&amp;ISOCountryCode=FR</a></li>\r\n<li>Vérifier si votre onduleur APC est toujours couvert par la garantie constructeur : <a href="http://www.apc.com/site/support/index.cfm/warranty-services/ups-factory-warranty-status/?ISOCountryCode=TN">http://www.apc.com/site/support/index.cfm/warranty-services/ups-factory-warranty-status/?ISOCountryCode=TN</a></li>\r\n</ul>\r\n<p> <br />Pour faciliter votre démarche, veuillez vous munir des informations suivantes :</p>\r\n<ul>\r\n<li><strong>N° de série de l\'appareil</strong></li>\r\n<li><strong>Facture d\'achat</strong></li>\r\n</ul>\r\n<div> </div>\r\n<p>Les garanties d\'onduleurs:</p>\r\n<p>- Les onduleurs EATON: <strong>2 ans constructeurs</strong> sauf pour le 5PX <strong>3 ans de batterie</strong></p>', 'enregistrement-garantie'),
	(10, 2, 'Comment choisir son onduleur', 'Configurateur onduleur', 'calcul, configurateur, puissance, dimenssioner, ASI, UPS', '<p style="font-style: normal; font-size: 11.333333015441895px; font-family: Verdana, Arial, Helvetica, sans-serif;"><span style="text-decoration: underline;">Mais qu\'est-ce qu\'un onduleur?</span></p>\r\n<p style="font-style: normal; font-size: 11.333333015441895px; font-family: Verdana, Arial, Helvetica, sans-serif;">Par abus de langage, le terme <strong>onduleur </strong>est utilisé pour désigner une<strong> Alimentation Sans Interruption</strong> (ASI) en anglais Uninterruptible Power Supply (UPS). Une <acronym style="font-size: 11.333333015441895px;" title="Alimentation Sans Interruption">ASI</acronym> est un appareil permettant de procurer une alimentation électrique <strong>stable</strong>, <strong>sans coupure</strong> à un système électrique. Parmi tous les modèles d\'<acronym style="font-size: 11.333333015441895px;" title="Alimentation Sans Interruption">ASI</acronym>, il existe 3 grandes <strong>topologies </strong>dans lesquelles nous pouvons les classer :</p>\r\n<ul style="font-style: normal; font-size: 11.333333015441895px; font-family: Verdana, Arial, Helvetica, sans-serif; list-style-position: inside;">\r\n<li style="font-size: 11.333333015441895px;"><a style="font-size: 11.333333015441895px;" title="onduleurs OFFLine" href="/5-onduleurs-off-line">en attente passive</a> (<em>offline</em> ou <em>passive</em> <em>standbye</em>)</li>\r\n<li style="font-size: 11.333333015441895px;"><a style="font-size: 11.333333015441895px;" title="Onduleurs Line-Interactive" href="/7-onduleurs-line-interactive">en interaction avec le réseau</a> (<em>line-interactive</em>)</li>\r\n<li style="font-size: 11.333333015441895px;"><a style="font-size: 11.333333015441895px;" title="Onduleurs ONLine" href="6-onduleur-double-conversion-on-line">à double conversion</a> (<em>online</em> ou <em>double conversion</em>)</li>\r\n</ul>\r\n<p style="font-style: normal; font-size: 11.333333015441895px; font-family: Verdana, Arial, Helvetica, sans-serif;">Suivant l\'<acronym style="font-size: 11.333333015441895px;" title="Alimentation Sans Interruption">ASI</acronym>, les <a style="font-size: 11.333333015441895px;" title="Trouver votre onduleur suivant l\'application" href="/content/6-chercher-onduleur-par-application">applications </a>sont très variées. Elles vont de la simple <strong>protection d\'un ordinateur personnel</strong> à la protection de <strong>systèmes critiques </strong>comme un bloc opératoire.</p>\r\n<p><img title="Bien choisir son onduleur" src="http://www.mononduleur.fr/img/divers/bien_choisir_son_onduleur.jpg" alt="Bien choisir son onduleur - comparatif ON LINE / LINE INTERACTIVE / ON LINE" width="550" height="764" /></p>\r\n<p> </p>\r\n<p><span style="text-decoration: underline;"><em><strong>Guide de choix Onduleur:</strong></em></span></p>\r\n<p>Afin de calculer la puissance optimale de votre onduleur cliquez sur les lines ci-dessous:</p>\r\n<p> </p>\r\n<p style="text-align: center;"><img title="logo puissance electrique" src="http://www.mononduleur.fr/themes/mononduleur/img/puissance_electrique.jpg" alt="logo puissance" /></p>\r\n<p><strong>EATON<br /></strong><a style="border-style: initial; border-color: initial; font-style: normal; font-size: 11px; font-family: Verdana, Arial, Helvetica, sans-serif;" href="http://powerware.eaton.com/UPS/selector/selector_france/SolutionOverview.asp">http://powerware.eaton.com/UPS/selector/selector_france/SolutionOverview.asp</a></p>\r\n<p><a href="http://www.changez-avec-eaton.fr/ressources/tools.aspx">http://www.changez-avec-eaton.fr/ressources/tools.aspx</a></p>\r\n<p><strong><span style="font-size: 11.333333015441895px;">APC<br /></span></strong><a href="http://www.apc.com/tools/ups_selector/pso/rslr/index.cfm?ISOCountryCode=FR" target="_blank">http://www.apc.com/tools/ups_selector/pso/rslr/index.cfm?ISOCountryCode=FR</a></p>\r\n<p><em><span style="text-decoration: underline;"><strong>Guide de choix prises parafoudre / parasurtenseur:</strong></span></em></p>\r\n<p><span style="font-size: 11.333333015441895px;">Pour choisir au mieux votre prise parafoudre / parasurtenseur cliquez sur le lien ci-dessous:</span></p>\r\n<p> <strong>EATON<br /></strong><a href="http://pqtools.eaton.com/selector2/surge/index.php?lang=fr" target="_blank">http://pqtools.eaton.com/selector2/surge/index.php?lang=fr</a></p>\r\n<p>Bien choisir son Onduleur:</p>\r\n<p><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">Beaucoup de gens pensent que le choix d\'un onduleur n\'est pas chose aisé. </span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">Cependant vous allez voir que les choses ne sont pas aussi compliqués qu\'il n\'y </span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">parait. Cela exige seulement quelque connaissances de base, ensuite les choix </span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">de votre onduleur dépendra du type de défaillances contre lesquels vous voulez </span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">vous protéger et du type d\'activité que vous exercé. </span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">I- </span><strong><span style="text-decoration: underline;">Notion de puissance</span></strong><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">Le choix de l\'onduleur le mieux adapté va avoir comme premier critère la consommation du matériel qu\'il va devoir suppléer en cas de panne. Pour se faire, il est essentiel d\'avoir quelques notions sur la puissance de consommation et son calcul.</span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">La puissance d\'un onduleur est exprimée en </span><strong><span>V.A., ou en Volts Ampères</span></strong><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">. Avant de choisir un onduleur, il faut </span><strong><span>faire la somme de la consommation de tous les appareils que l\'on va lui connecter</span></strong><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">.</span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">Le problème c\'est qu\'en général sur le matériel informatique, </span><strong>la consommation est exprimée en Watts</strong><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;"> Pour convertir rapidement des Watts en V.A. </span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">on peut utiliser cette formule approximative : </span><strong><span>Nombre VA = Nombre de Watts /0.66.</span></strong><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">Pour vous faciliter la tâche, voici quelque Valeurs communes pour matériels informatiques : </span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">- Pour 1 PC Classique : 200 Watt de consommation soit 300 VA de puissance</span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">- Pour 1 PC Serveur : 250 Watt de consommation soit 350 VA de puissance</span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">- Pour 1 Ecran standard : 90 Watt de consommation soit 150 VA de puissance</span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">Vous l\'aurez compris, il est donc essentiel de calculer la consommation total </span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">des appareils que vous voulez connecter à l\'onduleur et sa puissance en VA correspondante. </span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">Il vous sera ainsi plus facile da choisir entre les différents modèles et surtout </span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">cela vous évitera de vous retrouver avec un onduleur inefficace.</span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">II- </span><strong><span style="text-decoration: underline;">Défaillance électrique et solution</span></strong><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">Il est souvent pratique de savoir contre quel type de défaillance électrique </span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">on peut se prémunir et de quel façon l\'onduleur solutionne le problème. Ainsi </span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">le choix de l\'onduleur sera plus facile et plus précis.</span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">- Les </span><strong>Chutes de tension</strong><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;"> : Pour se premunir contre les chutes de tensions les Onduleurs IN-LINE ou ON-LINE sont efficaces. Ils vont offrir une régulation automatique de voltage (AVR). Plus concrètement, l\'onduleur va remonter la tension jusqu\'à la tension nominale, soit 230 V (Boost).</span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">- Les </span><strong>Surtensions</strong><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;"> : Pour solutionner les problème de surtension, les onduleurs IN-LINE ou ON-LINE sont efficaces. Ils vont aussi permettre la régulation automatique de voltage (AVR). Cette fois l\'onduleur va abaisser la tension jusqu\'à la tension nominale, soit 230 V (Buck).</span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">- Les </span><strong>Coupures</strong><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;"> : Les onduleurs IN-LINE ou ON-LINE régleront les problème de coupures en palliant l\'absence de courant du réseau. Plus simplement les appareils connectés seront alimentés par les batteries de l\'onduleur. </span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">- Les </span><strong>Pics</strong><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;"> : Les onduleurs IN-LINE ou ON-LINE règlent ce type de problème par la régulation automatique de voltage (AVR) / Parafoudre. Plus simplement l\'onduleur lisse la courbe de tension de sortie en supprimant les pics de tension.</span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">- Les </span><strong>Bruits</strong><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;"> : Les onduleurs IN-LINE ou ON-LINE vont permettre un filtrage des interférences électromagnétiques (EMI) et radio (RFI)/</span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">- Les </span><strong>Distorsions</strong><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;"> : Seule les onduleurs ON-LINE sont capables de solutionner </span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">ce type de problème reformant la sinusoïdale de la tension. Le courant ainsi </span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">produit est filtré en permanence.</span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">L\'ensemble de ces défaillances sont pris en charges par les onduleurs ce qui permet d\'obtenir une protection optimale.</span><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><br /><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">III- </span><strong><span style="text-decoration: underline;">Type d\'utilisation</span></strong><br style="font-family: verdana, sans-serif; font-size: 12px; text-align: justify; text-indent: 30px;" /><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">Le critère essentiel pour le meilleur choix d\'un onduleur reste sans nul doute le type d\'activité que vous effectuer. De ce fait nous avons classer les 3 catégories d\'onduleurs en fonction de leur mode d\'utilisation de ce fait il vous sera facile de trouver l\'onduleur le mieux approprier :</span></p>\r\n<ul>\r\n<li><strong>Les onduleurs OFF-LINE</strong><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;"> : La technologie basique et le temps de commutation trop long réduisent le champs d\'utilisation de ce type d\'onduleur. Ainsi ils seront recommandés pour les activités bureautiques basiques.</span></li>\r\n<li><strong>Les onduleurs IN-LINE</strong><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;"> : Son pilotage par micro processeur, son temps </span></li>\r\n</ul>\r\n<p><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">de commutation court et sa grande polyvalence rendent ce type d\'onduleurs compatible avec les activités suivantes : Environnements électriques urbains, applications bureautiques, jeux et activités multimédia, périphériques (fax, imprimantes, scanner, modem...)</span></p>\r\n<ul>\r\n<li><strong>Les onduleurs ON-LINE</strong><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;"> : Son système de reconstitution permanant du courant combiné à n temps de commutation nul pour un signal pur et régulé rend ce type d\'onduleur compatible avec les applications suivantes : Tout environnement électrique</span></li>\r\n</ul>\r\n<p><span style="font-family: verdana, sans-serif; font-size: 12px; font-style: normal; text-align: justify; text-indent: 30px;">même très perturbé, tous systèmes électroniques sensibles, gros serveurs informatiques, serveurs et applications de gestion, applications industrielles.</span></p>', 'calcul-de-puissance'),
	(11, 2, 'Nos Installations', '', 'Nos Installations', '<p>Pour vos installations d\'onduleurs et projets n\'hésitez pas à nous contacter!</p>\r\n<p> Nos partenaires Electrique et installateurs agréés:</p>\r\n<ul>\r\n<li>M. THOLIN (TBELEC)</li>\r\n<li>M. KERINEC (T.B\'ELEC)</li>\r\n</ul>\r\n<p> </p>\r\n<p>Nos exemples de projets réalisés :</p>\r\n<h4><span style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px;">CNRS: Protection de matériels sensibles.</span></h4>\r\n<ul>\r\n<li>ON LINE 9130 5KVA</li>\r\n<li>EBM (extension de batterie)</li>\r\n<li>Changement du tableau éléctrique pour raccordement de l\'onduleur</li>\r\n</ul>\r\n<p> </p>\r\n<p><img style="vertical-align: middle;" title="9130 5KVA" src="http://www.mononduleur.fr/img/installations/instalA1.jpg" alt="9130 5KVA" width="400" /></p>\r\n<p> <img title="9130 5KVA" src="http://www.mononduleur.fr/img/installations/instalA2.jpg" alt="9130 5KVA" width="400" height="533" /></p>\r\n<p> </p>\r\n<h4>Projet Protection de serveur et circuit ondulé:</h4>\r\n<ul>\r\n<li><span style="font-weight: normal;">Onduleur EATON 9130 5KVA</span></li>\r\n<li>Remise du circuit ondulé aux normes</li>\r\n</ul>\r\n<p>  </p>\r\n<p><img src="http://www.mononduleur.fr/img/installations/instalB1.jpg" alt="" width="400" /></p>\r\n<p><img src="http://www.mononduleur.fr/img/installations/instalB2.jpg" alt="" width="400" /></p>', 'nos-installations'),
	(12, 2, 'Ils nous font confiance / Partenaires', 'partenaires', 'CNRS, JARDILAND, JPG', '<p>MERCI aux soci&eacute;t&eacute;s qui nous font confiance</p>\r\n<p>&nbsp;</p>\r\n<p>Nos partenaires:</p>\r\n<p>- CNRS</p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://www.mononduleur.fr/img/partenaires/CNRS.jpg" alt="" width="200" /></p>\r\n<p>&nbsp;</p>\r\n<p>- JARDILAND</p>\r\n<p><img src="http://www.mononduleur.fr/img/partenaires/jardiland.jpg" alt="" width="200" /></p>\r\n<p>&nbsp;</p>\r\n<p>- etc.</p>', 'ils-nous-font-confiance');
